import React from "react";
import { Grid } from "@material-ui/core";
import { useDispatch } from "react-redux";
import { addBook } from "./store/action";
import img1 from "./img1.png";

const handleAdd = () => {};
function Add_Form() {
  const dispatch = useDispatch();

  return (
    <Grid>
      <Grid conatiner>
        IMAGE_SOURCE : <input type="text"></input>
      </Grid>

      <Grid container>
        NAME OF THE BOOK:<input type="text"></input>
      </Grid>

      <Grid container>
        AUTHOR:<input type="text"></input>
      </Grid>
      <Grid container>
        <input
          type="submit"
          onClick={() =>
            dispatch(
              addBook({
                img_src: img1,
                book_name: "HARRY POTTER NEW SEASON",
                author: "VIVEK REDDY S",
                time_left: "15 min to read",
                persons_read: "15.6k read",
              })
            )
          }
        ></input>
      </Grid>
    </Grid>
  );
}

export default Add_Form;
